var margin = {top: 100, right: 0, bottom: 0, left: 0};

var w = window.innerWidth - (margin.left + margin.right);
var h = window.innerHeight - (margin.top + margin.bottom);


var bar_thickness = 20;
var margin_between_bars = 10;

var animation_out_duration = 700;
var animation_in_duration = 700;

var low_color = "blue";
var center_color = "white"
var high_color = "red";
var color = d3.scaleLinear().domain([-x_max, 0, x_max])
                            .range([low_color, center_color, high_color]);

/////////////////////////////////////////////////////////////////////////////
                      ///////    Set Up Chart    ///////
/////////////////////////////////////////////////////////////////////////////

var svg = d3.select("#graph-container").append("svg").attr("xmlns", "http://www.w3.org/2000/svg").attr("xmlns:xlink", "http://www.w3.org/1999/xlink");
var g = svg.append("g").attr("transform", "translate("+margin.left+","+margin.top+")");
svg.style("cursor", "move");

var bar  = g.selectAll(".bar");
var text = g.selectAll(".text");
var title = g.selectAll(".title");



var minLogFC = _.min(Object.values(human))
var maxLogFC = _.max(Object.values(human))
var x_max    = _.max([Math.abs(minLogFC), Math.abs(maxLogFC)])

var x_neg = d3.scaleLinear().domain([-x_max, 0]).rangeRound([0, w/2 - 50]).nice();
var x_pos = d3.scaleLinear().domain([0, x_max]).rangeRound([w/2 + 50, w]).nice();

// var color = d3.scaleLinear().domain([-x_max, 0, x_max])
//                             .range([low_color, center_color, high_color]);

neg_axis = d3.axisTop(x_neg);
pos_axis = d3.axisTop(x_pos);

g.append("g")
 .attr("class", "axis axis--x")
 .call(neg_axis);

g.append("g")
 .attr("class", "axis axis--x")
 .call(pos_axis);

// grid lines
var neg_grid = d3.axisTop(x_neg).tickFormat("").tickSize(-h);
var pos_grid = d3.axisTop(x_pos).tickFormat("").tickSize(-h);

var grid_left = g.append("g")
                 .attr("class", "grid")
                 .style("stroke", "#ddd")
                 .style("opacity", 0.1)
                 .call(neg_grid);

var grid_right = g.append("g")
                  .attr("class", "grid")
                  .style("stroke", "#ddd")
                  .style("opacity", 0.1)
                  .call(pos_grid);




/////////////////////////////////////////////////////////////////////////////
                      ///////    Re-Draw Chart    ///////
/////////////////////////////////////////////////////////////////////////////

function restart(selected_GO_term, selected_genes) {

    logFCs = _.pick(human, selected_genes);
    data = _(Object.entries(logFCs)).sortBy(gene_and_logFC => -gene_and_logFC[1])
                                    .map(gene_and_logFC => {return {'id':gene_and_logFC[0], 'logFC':gene_and_logFC[1]}});

    index = {}; data.forEach((obj, i) => index[obj.id] = i+1);
    y_max = (data.length - 1) * (bar_thickness + margin_between_bars) + margin.top

    let y = (id) => index[id] * (bar_thickness + margin_between_bars);
    let x_start = (x) => x > 0 ? x_pos(0) : x_neg(x);
    let x_width = (x) => x > 0 ? x_pos(x)-x_pos(0) : x_neg(0)-x_neg(x);
    let x_start_before_animation = (x) => x > 0 ? x_pos(0) : x_neg(0);

    // title
    title = title.data([]);
    title.exit().remove();
    title = title.data([selected_GO_term]);
    title = title.enter()
               .append("a")
               .attr("xlink:href", "https://www.ebi.ac.uk/QuickGO/term/"+selected_GO_term.split(" ", 1).slice(0, -1))
               .style("cursor", "pointer")
               .append("text")
               .attr("font-family", "sans-serif")
               .attr("class", "title")
               .text(selected_GO_term)
               .style("text-anchor", "middle")
               .attr("x", (x_pos(0) + x_neg(0)) / 2)
               .attr("y", 0 )
               .attr("dy", "-3em");

    // gene symbols
    text = text.data([]);
    text.exit().remove();
    text = text.data(data);
    text = text.enter()
               .append("a")
               .attr("xlink:href", (d) => "http://www.genecards.org/cgi-bin/carddisp.pl?gene="+d.id)
               .style("cursor", "pointer")
               .append("text")
               .attr("font-family", "sans-serif")
               .attr("class", "text")
               .text((d) => d.id )
               .style("text-anchor", "middle")
               .attr("x", (x_pos(0) + x_neg(0)) / 2)
               .attr("y", (d) => y(d.id) )
               .attr("dy", "1em");

    // bars
    bar = bar.data([]);
    bar.exit()
       .transition()
       .duration(animation_out_duration)
       .attr("x", (d) => x_start_before_animation(d.logFC) )
       .attr("width", 0)
       .remove();

    bar = bar.data(data).enter()
             .append("rect")
             .attr("class", (d) => "bar bar--" + (d.logFC < 0 ? "negative" : "positive") )
             .attr("y", (d) => y(d.id) )
             .attr("height", bar_thickness)
             .attr("x", (d) => x_start_before_animation(d.logFC) )
             .attr("width", 0)
             .style("fill", (d) => color(d.logFC));
    bar.transition()
       .duration(animation_in_duration)
       .attr("x", (d) => x_start(d.logFC) )
       .attr("width", (d) => x_width(d.logFC) );

// grid lines
neg_grid = neg_grid.tickSize(-y_max);
pos_grid = pos_grid.tickSize(-y_max);

grid_left.remove();
grid_right.remove();

grid_left = g.append("g")
             .attr("class", "grid")
             .style("stroke", "#ddd")
             .style("opacity", 0.1)
             .call(neg_grid);

grid_right = g.append("g")
             .attr("class", "grid")
             .style("stroke", "#ddd")
             .style("opacity", 0.1)
             .call(pos_grid);


}



/////////////////////////////////////////////////////////////////////////////
                      ///////   Zoom & Resize    ///////
/////////////////////////////////////////////////////////////////////////////


svg.call(d3.zoom()
           .scaleExtent([1 / 8, 8])
           .on("zoom", zoomed));

function zoomed() { g.attr("transform", d3.event.transform); }



function resize() {
    svg.attr("width", window.innerWidth).attr("height", window.innerHeight);
    w = window.innerWidth - (margin.left + margin.right);
    h = window.innerHeight - (margin.top + margin.bottom);
}

d3.select(window).on("resize", resize)

resize();


/////////////////////////////////////////////////////////////////////////////
                 ///////    Download SVG    ///////
/////////////////////////////////////////////////////////////////////////////


d3.select("#download").on("click", function() {

    d3.select(this)
      .attr("href", 'data:application/octet-stream;base64,' + btoa(unescape(encodeURIComponent(d3.select("#graph-container").html()))))
      .attr("download", "plot.svg")
})

$('#hide-show').click(function(e) { $('.go-picker').toggleClass('hidden'); });


var input = document.getElementById("chooseGO");
var form = new Awesomplete(input, {
    list: Object.entries(go),
    maxItems: 30,
    replace: function (text) { this.input.value = text.label; }
});
document.addEventListener('awesomplete-selectcomplete', function(e) {
    selected_GO_term = e.text.label;
    selected_genes = e.text.value;
    restart(selected_GO_term, selected_genes);
});

    </script>
